import styled from 'styled-components';

const HeaderContainer = styled.header`
  position: relative;
  display: flex;
  justify-content: space-between;
  align-items: center;
  min-width: 320px;
`;

const LogoThumb = styled.div`
  padding-left: 20px;
  padding-top: 24px;
`;

const HeaderLinkArea = styled.a`
  padding: 15px 0;
`;

const MenuContainer = styled.div`
  padding-left: 30px;
  padding-top: 49px;
`;

const SiteNav = styled.ul`
  display: flex;
  gap: 50px;
  list-style: none;
`;

const SiteNavItem = styled.li`
  margin-bottom: 32px;
`;

const SiteNavLink = styled.a`
  font-family: 'Josefin Sans', sans-serif;
  font-style: normal;
  font-weight: 600;
  font-size: 20px;
  line-height: 28px;
  color: #E4E2DD;
  text-decoration: none;
`;
